import React from 'react';
import { Link } from 'react-router-dom';

const NavBar =()=>{
  return (
    <div>
      <Link to="/"><p>Logo</p></Link>
      <Link to="/WORK"><p>About</p></Link>
      <Link to="/projects"><p>Projects</p></Link>
    </div>
  )
}

export default NavBar;
